import React from 'react';
import './Blog.css';

const Blog = () => {
  return (
    <section id="blog" className="blog">
      <h2>Blog</h2>
      <p>Share medical insights, health tips, and recent advancements in your field.</p>
    </section>
  );
};

export default Blog;
